import React, { useState } from "react";

function ResultTables(props) {
  // 0 :{year: 1, yearlyInterest: 0.25, savingsEndOfYear: 10.25, yearlyContribution: 5}

  props.dataTable.map((year) => {
    <tr>
      <td>{year.year}</td>
      <td>{year.savingsEndOfYear}</td>
      <td>{year.yearlyInterest}</td>
      <td>{0}</td>
      <td>{0}</td>
    </tr>;
  });

  return (
    <div>
      <table className="result">
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>YEAR NUMBER</td>
            <td>TOTAL SAVINGS END OF YEAR</td>
            <td>INTEREST GAINED IN YEAR</td>
            <td>TOTAL INTEREST GAINED</td>
            <td>TOTAL INVESTED CAPITAL</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default ResultTables;
